import 'reflect-metadata';
import {
	internalMetadataKey,
	modelKeyMetadataKey,
	rawKeyMetadataKey,
	Serial,
	SerializationOptions,
	serialMetadataKey
} from './serializers/serial';
import {Serializable} from './decorators/serial.decorator';

export type RecursivePartial<T> = {
	[P in keyof T]?:
	T[P] extends (infer U)[] ? RecursivePartial<U>[] :
		T[P] extends object ? RecursivePartial<T[P]> :
			T[P];
};

export interface Identifiable {
	key: string;
}

type Override<T, R> = Pick<T, Exclude<keyof T, keyof R>> & R;
type RawFromMapping<T extends Mapping<any>> = T extends Mapping<infer Raw> ? Raw : never;
// tslint:disable-next-line:no-shadowed-variable
type RawFromModel<T extends Model<any>> = T extends Model<infer Mapping> ? RawFromMapping<Mapping> : never;

export type Model<T extends Mapping<any>, Raw = RawFromMapping<T>> = Override<Raw, T>;

export interface ModelConstructor<T extends Model<any>, Raw = RawFromModel<T>> extends Serial<Raw, T> {
	new(model?: Partial<T>): T;
}

// tslint:disable-next-line:no-shadowed-variable
export function createModel<T>(Mapping: ModelConstructor<any>): ModelConstructor<T> {
	Mapping.serialize = Mapping.serialize.bind(Mapping);
	Mapping.deserialize = Mapping.deserialize.bind(Mapping);
	return Mapping as any as ModelConstructor<T>;
}

export abstract class Mapping<Raw> {
	static serialize<MappingConstructor extends new(model?: any) => any,
		// tslint:disable-next-line:no-shadowed-variable
		Mapping extends InstanceType<MappingConstructor>,
		Raw extends RawFromMapping<Mapping>>(this: MappingConstructor, model?: Model<Mapping>, options?: SerializationOptions): Raw {
		if (model === undefined) {
			return undefined;
		}
		if (model === null) {
			return null;
		}
		return model.toJSON(undefined, options);
	}

	static deserialize<MappingConstructor extends new(model?: any) => any,
		// tslint:disable-next-line:no-shadowed-variable
		Mapping extends InstanceType<MappingConstructor>,
		Raw extends RawFromMapping<Mapping>>(this: MappingConstructor, raw?: Raw): Mapping {
		if (raw === undefined) {
			return undefined;
		}
		if (raw === null) {
			return null;
		}
		return new this().applyRaw(raw);
	}

	constructor(model?: any) {
		this.apply(model as this);
	}

	apply(model?: Partial<this>): this {
		Object.assign(this, model);
		return this;
	}

	/**
	 * Update the model's properties from the raw JSON object's properties
	 * @param raw {Raw}
	 * @returns {Mapping}
	 */
	applyRaw(raw?: Partial<Raw>): this {
		if (!raw) {
			return this;
		}
		const model: any = {};
		const keys = Object.keys(raw) as (keyof Raw)[];
		for (const key of keys) {
			const value = raw[key];
			const modelKey: string | undefined = Reflect.getMetadata(modelKeyMetadataKey, this, key as string) || key;
			const serial: Serializable | undefined = Reflect.getMetadata(serialMetadataKey, this, modelKey);
			if (serial) {
				if (Array.isArray(serial)) {
					if (Array.isArray(value)) {
						model[modelKey] = value.map(v => serial[0].deserialize(v));
					}
				} else {
					model[modelKey] = serial.deserialize(value);
				}
			} else {
				model[modelKey] = value;
			}
		}
		return this.apply(model);
	}

	// even though we are not using `parentKey`, it's there for a placeholder as the first param of `toJSON` is being used by Node.js
	toJSON(parentKey?: string, options?: SerializationOptions): Raw {
		const raw: any = {};
		const keys = Object.keys(this) as (keyof this)[];
		const internalKeys = Reflect.getMetadata(internalMetadataKey, this) || [];
		for (const key of keys) {
			if (!(options && options.internals) && internalKeys.includes(key)) {
				continue;
			}
			const value = this[key];
			const rawKey: string | undefined = Reflect.getMetadata(rawKeyMetadataKey, this, key as string) || key;
			const serial: Serializable | undefined = Reflect.getMetadata(serialMetadataKey, this, key as string);
			if (serial) {
				if (Array.isArray(serial)) {
					if (Array.isArray(value)) {
						raw[rawKey] = value.map(v => serial[0].serialize(v, options));
					}
				} else {
					raw[rawKey] = serial.serialize(value, options);
				}
			} else {
				raw[rawKey] = value;
			}
		}
		return raw as Raw;
	}

	// serialize + stringify + parse + deserialize = deep clone
	clone(options: SerializationOptions = {internals: true}): this {
		const raw = JSON.parse(JSON.stringify(this.toJSON(undefined, options)));
		// tslint:disable-next-line:no-shadowed-variable
		const Model = this.constructor as new(model?: any) => this;
		return new Model().applyRaw(raw);
	}
}

import {Injectable} from '@angular/core';
import {Router} from '@angular/router';
import {RouterStateUrl} from '@core/root-store/models/app-state.model';
import {RouterReducerState} from '@ngrx/router-store';
import {Store} from '@ngrx/store';
import * as fromRoot from '@core/root-store';
import {pairwise} from 'rxjs/operators';

export interface iFromToRouterHistory {
	from: RouterReducerState<RouterStateUrl>;
	to: RouterReducerState<RouterStateUrl>;
}

/**
 * Maintain a history of navigation events and provide helper methods
 * for differentiating between view changes and page changes. To determine
 * the difference we're assuming that a view change will be via query params
 * and that a page will not have any query params
 */
@Injectable({
	providedIn: 'root'
})
export class RouterStateService {
	private _navigationHistory: RouterReducerState<RouterStateUrl>[] = [];
	private _fromToHistory: iFromToRouterHistory[] = [];
	private _pageHistory: RouterReducerState<RouterStateUrl>[] = [];

	constructor(
		private _router: Router,
		private store: Store<{router}>
	) {
		this._listenToStore();
	}

	/**
	 * Listen to the router state to populate history information
	 * @private
	 */
	private _listenToStore() {
		this.store.select(fromRoot.selectRouterState)
			.pipe(
				pairwise()
			)
			.subscribe(([oldRoute, newRoute]) => {
				this._fromToHistory = [...this._fromToHistory, {from: oldRoute, to: newRoute}];
				this._navigationHistory = [...this._navigationHistory, newRoute];
				if (!Object.keys(newRoute.state.queryParams).length) {
					this._pageHistory = [...this._pageHistory, newRoute];
				}
				this.doCleanup();
			});
	}

	/**
	 * Clean up the history items. We want want to only keep what is necessary.
	 * Once we get 27 items in any of the history arrays we want to remove the first
	 * 25 items leaving the current and previous history items
	 */
	doCleanup() {
		if (this._fromToHistory.length > 26) {
			this._fromToHistory.splice(0, 25);
		}
		if (this._pageHistory.length > 26) {
			this._pageHistory.splice(0, 25);
		}
		if (this._navigationHistory.length > 26) {
			this._navigationHistory.splice(0, 25);
		}
	}

	/**
	 * An array of router states as the user navigates. Mimics history
	 */
	get navigationHistory() {
		return this._navigationHistory;
	}

	/**
	 * Array of urls the user navigated to
	 */
	get navigationUrlHistory() {
		return this._navigationHistory.map(routerState => routerState.state.url);
	}

	/**
	 * Array of page router states the user has navigated to
	 */
	get pageHistory() {
		return this._pageHistory;
	}

	/**
	 * Array of page urls the user has navigated to
	 */
	get pageUrlHistory() {
		return this._pageHistory.map(routerState => routerState.state.url);
	}

	/**
	 * Array of navigations that shows where a user navigated from and where they
	 * navigated to
	 */
	get fromToHistory() {
		return this._fromToHistory;
	}

	/**
	 * Array of navigations that shows the URLs where a user navigated from and where they
	 * navigated to
	 */
	get fromToUrlHistory() {
		return this._fromToHistory.map(historyState => ({from: historyState.from?.state.url, to: historyState.to?.state.url}));
	}

	/**
	 * Get the user's previous URL
	 */
	get previousUrl() {
		if (this._fromToHistory.length) {
			return this._fromToHistory[this._fromToHistory.length - 1].from?.state.url;
		}
		return undefined;
	}

	/**
	 * Get the user's previous Page URL
	 */
	get previousPageUrl() {
		if (this._pageHistory.length) {
			let prevPageUrl = this._pageHistory[this._pageHistory.length - 1]?.state.url;
			if (prevPageUrl === this.currentPageUrl) {
				prevPageUrl = this._pageHistory[this._pageHistory.length - 2]?.state.url;
			}
			return prevPageUrl;
		}
		return undefined;
	}

	/**
	 * Get the current user parameters
	 */
	get currentQueryParams() {
		const navHistory = this.navigationHistory;
		const currentPageState = navHistory[navHistory.length - 1];
		return currentPageState.state.queryParams;
	}

	/**
	 * Get the current full url
	 */
	get currentUrl() {
		const navHistory = this.navigationHistory;
		const currState = navHistory[navHistory.length - 1];
		return currState.state.url;
	}

	/**
	 * Get the current page url (no query parameters included)
	 */
	get currentPageUrl() {
		const currPageUrl = this.currentUrl.split('?');
		return currPageUrl[0];
	}
}

import {Injectable} from '@angular/core';
import {
	AbstractControl,
	AbstractControlOptions,
	FormArray,
	FormBuilder,
	FormControl,
	FormGroup,
	ValidationErrors,
	ValidatorFn
} from '@angular/forms';
import {Logger} from '@core/services/logger/logger';
import {ServiceLocator} from '@core/services/service-locator';

/** Interface for an invalid control */
export interface InvalidControl {
	fieldName: string;
	control: AbstractControl;
}
/** Interface for invalid control with errors included */
export interface InvalidControlErrors extends InvalidControl {
	errors: ValidationErrors;
}
/** Interface for a ValidatorConfig object, used in setFormGroupValidators */
export interface ValidatorConfig {
	fieldName: string;
	validators: ValidatorFn[];
}

export type FormGroupConfig = AbstractControlOptions | FormGroupObjectConfig;
export type FormGroupObject = {[key: string]: any};
/**
 * Key must exist in FormGroupObject. The value of that key will be
 * an AbstractControlOptions object which will be applied to a FormControl
 */
export type FormGroupObjectConfig = {[key in keyof FormGroupObject]: FormGroupConfig};
export type FormControlType = 'FormGroup' | 'FormArray' | 'FormControl';
export type FormControlStatus = 'VALID' | 'INVALID' | 'DISABLED' | 'PENDING';

/**
 * This is a class of static methods to assist working with Reactive Forms
 */
@Injectable({
	providedIn: 'root'
})
export class FormHelperService {

	constructor() {}

	/**
	 * Take an object with values and build a FormGroup from it. If that object contains
	 * array values a FormArray will be created. If the obj contains a property that is an object
	 * another FormGroup will be created.
	 *
	 * The biggest draw back to using this method is you will have to manually create validators
	 * @param obj
	 * @param objConfig
	 * @example
	 *
	 * const someObj = {foo: 'bar', bar: 'baz', baz: [1,2], boo: {abc: 123}}
	 * const someObjFormGroup = FormBuilderService.convertObjToFormGroup(someObj);
	 * console.log('someObjFormGroup.controls=', someObjFormGroup.controls);
	 * {
	 *   foo: FormControl,
	 *   bar: FormControl,
	 *   baz: FormArray (controls: {0: 1 (FormControl), 1: 2 (FormControl)}),
