import {HttpErrorResponse} from '@angular/common/http';
import {ErrorHandler, Injectable} from '@angular/core';
import {Logger} from '@core/services/logger/logger';
import {NotificationService} from '@core/services/notification/notification.service';
import {SnackbarConfig, SnackbarMessageTypes} from '@shared/components/snack-bar/snack-bar.interface';
import {Subject, throwError} from 'rxjs';

/**
 * This service is for surfacing errors in the UI. By default, we'll notify the user with a snackbar (toast) message.
 * You should only need to include this service if you need to surface errors in the ui or need to notify the user
 * of errors.
 */
@Injectable({
	providedIn: 'root'
})
export class AppErrorHandler extends ErrorHandler {
	public errorEvent: Subject<Error> = new Subject<any>();

	constructor() {
		super();
	}

	/**
	 * Create a snackbar notification
	 * @param {number} notificationCode - An error code or Http Status
	 * @param {string} notification - The notification message
	 */
	notifyUserSnackbar(notificationCode: number, notification: string) {
		const snackbarConfig: SnackbarConfig = {
			message: `${notificationCode}: ${notification}`,
			duration: 5000,
			messageType: SnackbarMessageTypes.DANGER
		};
		NotificationService.showSnackbar(snackbarConfig);
	}

	/**
	 * This function is a global javascript error handler. It will catch all javascript errors
	 * produced within the application. The docs at https://angular.io/api/core/ErrorHandler say
	 * that err has a type of any. I'm assuming the "any" type is so you can pass it a custom error
	 * or error event. console logging the err argument just outputs the stack trace.
	 *
	 * If an error occurs within a try/catch block, this will not be fired unless you
	 * throw the error within the catch block.
	 *
	 * I understand I've got repeated code below, but this is merely a placeholder so that
	 * custom logic can be introduced based on the error type (err.name). You probably don't
	 * want to break it down to that level but instead send to a DB, throw a dialog
	 * for debugging, etc.
	 *
	 * Definition is in @see{src/app/core/core.module.ts}
	 *
	 * @param err {Error}
	 */
	handleError(err: Error) {
		let message = err?.message || '[AppErrorHandler.handleError] Unknown error';
		if (err instanceof EvalError) {
			message = err.message;
		}else if (err instanceof RangeError) {
			message = err.message;
		}else if (err instanceof ReferenceError) {
			message = err.message;
		}else if (err instanceof SyntaxError) {
			message = err.message;
		}else if (err instanceof TypeError) {
			message = err.message;
		}else if (err instanceof URIError) {
			message = err.message;
		}else if (err instanceof ErrorEvent) {
			message = err.error.message;
		}
		Logger.error(message, err);
		this.errorEvent.next(err);
	}
}

import {Injectable} from '@angular/core';
import {Logger} from '@core/services/logger/logger';
import {BehaviorSubject} from 'rxjs';
import {tap} from 'rxjs/operators';
import {ApiEndpoints, ApiMethod} from '@core/interfaces/api.interface';
import {LocalStorageTypes} from '@core/services/local-storage/local-storage.interface';
import {ChangeUserPassword, RawUser, User} from '@core/models/user.model';
import {AppErrorHandler} from '@core/services/error-handler/error-handler.service';
import {HttpService} from '@core/services/http/http.service';
import {LocalStorageService} from '@core/services/local-storage/local-storage.service';

@Injectable({
	providedIn: 'root'
})
export class AuthService {
	authData: BehaviorSubject<RawUser> = new BehaviorSubject<RawUser>(null);

	constructor(
		private _http: HttpService,
		private _error: AppErrorHandler
	) {}

	/**
	 * Determine if current user is authenticated or not
	 * @returns {boolean}
	 */
	isAuthenticated() {
		return !!LocalStorageService.getItem(LocalStorageTypes.SESSION, 'user');
	}

	/**
	 * Get the current user
	 * @returns {User}
	 */
	getUser() {
		return User.deserialize(LocalStorageService.getItem(LocalStorageTypes.SESSION, 'user'));
	}

	/**
	 * Get the current user's initials
	 * @returns {string}
	 */
	getUserInitials() {
		if (this.getUser()) {
			return this.getUser().initials;
		}
		return null;
	}

	/**
	 * Perform the login and store the returned user in sessionStorage
	 * @param loginData {RawUser}
	 * @returns {Observable<User>}
	 */
	login(loginData: RawUser) {
		return this._http.doRequest(ApiEndpoints.LOGIN, ApiMethod.POST, loginData)
			.pipe(tap((rawUser: User) => {
				Logger.info('User Logged in', rawUser);
				this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * Perform a logout and remove the current user from sessionStorage
	 * @returns {Observable<User>}
	 */
	logout() {
		return this._http.doRequest(ApiEndpoints.LOGOUT, ApiMethod.GET)
			.pipe(tap((response) => {
				Logger.info('User logged out', this.getUser());
				LocalStorageService.removeItem(LocalStorageTypes.SESSION, 'user');
				this.authData.next(null);
				return response;
			}));
	}

	/**
	 * Perform a registration and store the returned user in sessionStorage
	 * @param {RawUser} registrationData
	 * @returns {Observable<User>}
	 */
	register(registrationData) {
		return this._http.doRequest(ApiEndpoints.REGISTER, ApiMethod.POST, registrationData)
			.pipe(tap((rawUser: User) => {
				Logger.info('User registered', rawUser);
				return this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * Change a user's password
	 * @param {RawUser} chgPwData
	 * @returns {Observable<User>}
	 */
	changePassword(chgPwData: ChangeUserPassword) {
		return this._http.doRequest(ApiEndpoints.CHANGE_PW, ApiMethod.PUT, chgPwData)
			.pipe(tap((rawUser: User) => {
				Logger.info('User changed password', rawUser);
				return this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * Provide user a means to reset their password
	 * @param forgotPwData
	 * @return {Observable<User>}
	 */
	forgotPassword(forgotPwData) {
		return this._http.doRequest(ApiEndpoints.FORGOT, ApiMethod.PUT, forgotPwData)
			.pipe(tap((rawUser: User) => {
				Logger.info('User forgot password', rawUser);
				this.updateLocalUser(rawUser);
			}));
	}

	/**
	 * update a user's object in session storage
	 * @param user
	 * @returns {User}
	 */
	updateLocalUser(user: User) {
		LocalStorageService.setItem(LocalStorageTypes.SESSION, 'user', user);
		this.authData.next(user);
		return user;
	}
}

import {Injectable} from '@angular/core';
import {NavigationEnd, NavigationStart, Router} from '@angular/router';
import {BehaviorSubject} from 'rxjs';
import {titleCaseString} from '@shared/utils/string.utils';
import {Breadcrumb} from '@layout/interfaces/breadcrumb.interface';

/**
 * Provides management of breadcrumbs base on the route
 */
@Injectable({
	providedIn: 'root'
})
export class BreadcrumbService {
	breadcrumbs: Breadcrumb[] = [];
	breadcrumbsSub: BehaviorSubject<any[]> = new BehaviorSubject<Breadcrumb[]>([]);

	/**
	 * BreadcrumbService constructor. Subscribes to router events and updates breadcrumbs
	 * accordingly
	 * @param _router
	 * @constructor
	 */
	constructor(
		private _router: Router
	) {
		_router.events.subscribe((evt) => {
			if (evt instanceof NavigationStart) {
				if (evt.navigationTrigger === 'popstate') {
					this.goBackOne();
				}
			} else if (evt instanceof NavigationEnd) {
				const title = this._getBcTitle(evt.urlAfterRedirects);
				if (title && title !== 'Unknown') {
					this.addBreadcrumb({
						url: evt.urlAfterRedirects,
						title
					});
				}
			}
		});
	}

	/**
	 * Add a breadcrumb to the breadcrumbs array
	 * @param breadCrumb {Breadcrumb}
	 */
	addBreadcrumb(breadCrumb: Breadcrumb) {
		const breadcrumbExists = this.breadcrumbs.find(bc => bc.url === breadCrumb.url);
		if (!breadcrumbExists) {
			this.breadcrumbs.push(breadCrumb);
			this.breadcrumbsSub.next(this.breadcrumbs);
		}
	}

	/**
	 * Go back one breadcrumb
	 */
	goBackOne() {
		this.breadcrumbs.pop();
		this.breadcrumbsSub.next(this.breadcrumbs);
	}

	/**
	 * Get the breadcrumb title from the route
	 * @param url {string}
	 * @returns {string}
	 * @private
	 */
	private _getBcTitle(url: string): string {
		const urlArr = url.split('/');
		const unCasedTitle = urlArr[urlArr.length - 1] || 'Unknown';
		return titleCaseString(unCasedTitle);
	}

}

