import {Injectable} from '@angular/core';
import {
	AbstractControl,
	AbstractControlOptions,
	FormArray,
	FormBuilder,
	FormControl,
	FormGroup,
	ValidationErrors,
	ValidatorFn
} from '@angular/forms';
import {Logger} from '@core/services/logger/logger';
import {ServiceLocator} from '@core/services/service-locator';

/** Interface for an invalid control */
export interface InvalidControl {
	fieldName: string;
	control: AbstractControl;
}
/** Interface for invalid control with errors included */
export interface InvalidControlErrors extends InvalidControl {
	errors: ValidationErrors;
}
/** Interface for a ValidatorConfig object, used in setFormGroupValidators */
export interface ValidatorConfig {
	fieldName: string;
	validators: ValidatorFn[];
}

export type FormGroupConfig = AbstractControlOptions | FormGroupObjectConfig;
export type FormGroupObject = {[key: string]: any};
/**
 * Key must exist in FormGroupObject. The value of that key will be
 * an AbstractControlOptions object which will be applied to a FormControl
 */
export type FormGroupObjectConfig = {[key in keyof FormGroupObject]: FormGroupConfig};
export type FormControlType = 'FormGroup' | 'FormArray' | 'FormControl';
export type FormControlStatus = 'VALID' | 'INVALID' | 'DISABLED' | 'PENDING';

/**
 * This is a class of static methods to assist working with Reactive Forms
 */
@Injectable({
	providedIn: 'root'
})
export class FormHelperService {

	constructor() {}

	/**
	 * Take an object with values and build a FormGroup from it. If that object contains
	 * array values a FormArray will be created. If the obj contains a property that is an object
	 * another FormGroup will be created.
	 *
	 * The biggest draw back to using this method is you will have to manually create validators
	 * @param obj
	 * @param objConfig
	 * @example
	 *
	 * const someObj = {foo: 'bar', bar: 'baz', baz: [1,2], boo: {abc: 123}}
	 * const someObjFormGroup = FormBuilderService.convertObjToFormGroup(someObj);
	 * console.log('someObjFormGroup.controls=', someObjFormGroup.controls);
	 * {
	 *   foo: FormControl,
	 *   bar: FormControl,
	 *   baz: FormArray (controls: {0: 1 (FormControl), 1: 2 (FormControl)}),
	 *   boo: FormGroup (controls: {abc: 123 (FormControl)})
	 * }
	 *
	 * // with options
	 * const someObj = {foo: 'bar', bar: 'baz', baz: [1,2], boo: {abc: 123}}
	 * const someObjOptions = {foo: {updateOn: 'blur'}}
	 * const someObjFormGroup = FormBuilderService.convertObjToFormGroup(someObj, someObjOptions);
	 * console.log('someObjFormGroup.controls=', someObjFormGroup.controls);
	 * {
	 *   foo: FormControl,
	 *   bar: FormControl,
	 *   baz: FormArray (controls: {0: 1 (FormControl), 1: 2 (FormControl)}),
	 *   boo: FormGroup (controls: {abc: 123 (FormControl)})
	 * }
	 */
	static convertObjToFormGroup(obj: FormGroupObject, objConfig?: FormGroupObjectConfig): FormGroup {
		if (obj !== null && obj !== undefined && typeof obj !== 'boolean') {
			let fb = ServiceLocator.injector?.get(FormBuilder);
			if (!fb) {
				fb = new FormBuilder();
			}
			if (fb) {
				const group = fb.group({});
				Object.keys(obj).forEach((key) => {
					const controlConfig = objConfig ? objConfig[key] : undefined;
					const keyVal = obj[key];
					if (Array.isArray(keyVal)) {
						const formArr = this.convertArrayToFormArray(keyVal);
						group.addControl(key, formArr);
					} else if (keyVal instanceof Date) {
						const dateCtl = fb.control(keyVal, controlConfig);
						group.addControl(key, dateCtl);
					} else if (keyVal !== null && typeof keyVal === 'object') { // typeof null = 'object' so take that into account
						const childGrp = this.convertObjToFormGroup(keyVal, controlConfig as any);
						group.addControl(key, childGrp);
					} else if (typeof keyVal === 'string' || typeof keyVal === 'number' || typeof keyVal === 'boolean') {
						const ctrl = fb.control(keyVal, controlConfig);
						group.addControl(key, ctrl);
					} else {
						const emptyCtl = fb.control(keyVal, controlConfig);
						group.addControl(key, emptyCtl);
					}
				});
				return group;
			}
		}
		// throw new Error('Nothing provided to convertObjToFormGroup');
		Logger.warn('Nothing provided to convertObjToFormGroup', obj);
	}

	/**
	 * Take an array of items and convert them to a FormArray. This is for an array of objects,
	 * array of boolean will not work
	 * @param arr
	 * @param forCheckboxes
	 */
	static convertArrayToFormArray(arr: any[], forCheckboxes: boolean = false): FormArray {
		let fb = ServiceLocator.injector?.get(FormBuilder);
		if (!fb) {
			fb = new FormBuilder();
		}
		if (fb && !forCheckboxes) {
			let valArr = [];
			if (arr?.length) {
				valArr = arr.map((obj) => {
					if (typeof obj === 'boolean' || typeof obj === 'string' || typeof obj === 'number' || obj instanceof Date) {
						return new FormControl(obj);
					} else if (obj !== null && typeof obj === 'object') {
						return FormHelperService.convertObjToFormGroup(obj);
					} else if (Array.isArray(obj)) {
						return FormHelperService.convertArrayToFormArray(obj);
					} else {
						return new FormControl(obj);
					}
				});
			}
			return fb.array(valArr);
		} else {
			// todo: implement a checkbox solution to prevent ending up with an array of booleans instead of an array of objects
		}
	}

	/**
	 * Get the controls in a form group as an array (not a FormArray) in order to loop through them
	 * and do something to the individual controls. FormGroup.controls normally returns an object.
	 * @param formGroup
	 */
	static formGroupControlsToArray(formGroup: FormGroup): AbstractControl[] {
		const returnVal = [];
		if (formGroup?.controls) {
			Object.keys(formGroup.controls).forEach((key) => {
				returnVal.push(formGroup.get(key));
			});
		}
		return returnVal;
	}

	/**
	 * returns just the invalid children of the provided FormGroup. If a child is an invalid FormGroup or FormArray will return
	 * the FormGroup/FormArray and NOT it's invalid FormControls
	 * @param formGroup
	 */
	static getInvalidFormGroupControls(formGroup: FormGroup): InvalidControl[] {
		const returnVal = [];
		if (formGroup?.controls) {
			Object.keys(formGroup.controls).forEach((key) => {
				const ctrl = formGroup.get(key);
				if (ctrl.invalid) {
					returnVal.push({fieldName: key, control: ctrl});
				}
			});
		}
		return returnVal;
	}

	/**
	 * Sets validators on a FormGroup based on the ValidatorConfig. If
	 * validatorConfigs is an empty array, will remove all validators for each
	 * control in the formGroup.
	 *
	 * NOTE: If your formGroup contains formGroups or FormArrays, will not recursively add validators
	 * to child FormGroups, only top level controls
	 *
	 * @param validatorConfigs
	 * @param formGroup
	 * @example
	 *
	 * const fg = FormBuilderService.convertObjToFormGroup({firstName: 'foo'});
	 * const validators: ValidatorConfig[] = [
	 * 	{fieldName: 'firstName', validators: [Validators.required]}
	 * ];
	 * FormBuilderService.setFormGroupValidators(validators, fg);
	 */
	static setFormGroupValidators(validatorConfigs: ValidatorConfig[], formGroup: FormGroup) {
		const formGroupKeys = Object.keys(formGroup?.controls || {});
		if (validatorConfigs && formGroupKeys.length) {
			formGroupKeys.forEach((ctrlFieldName) => {
				const fgControl = formGroup.get(ctrlFieldName);
				const controlValidators = validatorConfigs.find(validator => validator.fieldName === ctrlFieldName)?.validators;
				if (controlValidators?.length) {
					fgControl.setValidators(controlValidators);
				} else {
					fgControl.clearValidators();
				}
			});
		}else if (!validatorConfigs || !formGroup) {
			const missing = !validatorConfigs
				? {arg: 'validatorConfigs', value: validatorConfigs}
				: !formGroup
					? {arg: 'formGroup', value: formGroup}
					: !validatorConfigs && !formGroup
						? {arg: 'both', value: [validatorConfigs, formGroup]}
						: {arg: 'nothing', value: undefined};
			console.warn(`[FormBuilderService.setFormGroupValidators] Missing arguments ${missing.arg} (${missing.value})`);
		}else if (!formGroupKeys.length) {
			console.warn('[FormBuilderService.setFormGroupValidators] FormGroup contain 0 controls',
				validatorConfigs, formGroup);
		}
	}

	/**
	 * returns the invalid FormControls only. Will not return invalid FormGroups or FormArrays
	 * @param formControl
	 */
	static getInvalidControls(formControl: AbstractControl): InvalidControlErrors[] {
		// tslint:disable-next-line:max-line-length
		// console.log(`getInvalidControls, ${FormBuilderService.getControlName(formControl)} - ${FormBuilderService.getControlType(formControl)}`);
		let invalidControls: InvalidControlErrors[] = [];
		if (formControl) {
			if ((formControl instanceof FormGroup || formControl instanceof FormArray) && formControl.invalid) {
				Object.keys(formControl.controls).forEach((key) => {
					const childCtrl = formControl.get(key);
					const grpInvalidControls = FormHelperService.getInvalidControls(childCtrl);
					invalidControls = [...invalidControls, ...grpInvalidControls];
				});
			} else if (formControl.invalid) {
				invalidControls.push({
					fieldName: FormHelperService.getControlName(formControl),
					control: formControl,
					errors: formControl.errors
				});
			}
		}
		return invalidControls;
	}

	/**
	 * Get the name of an AbstractControl (i.e. FormGroup, FormArray, FormControl). If we've reached
	 * the top of the tree (meaning the very first form control) return 'TopControl'
	 * @param control
	 */
	static getControlName(control: AbstractControl): string {
		const parentControls = control.parent?.controls;
		if (parentControls) {
			return Object.keys(parentControls).find(name => control === parentControls[name]);
		} else {
			return 'TopControl';
		}
	}

	/**
	 * Get the full path of a control from the top of the FormGroup/FormArray
	 * @param control
	 * @example
	 *
	 * // Normally you would just have the control and probably not know the path.
	 * // This makes this example a little silly, because you already have the path
	 * // but I think it at least shows the concept of using the function
	 * const fg = FormHelperService.convertObjToFormGroup({foo: {bar: { baz: [{boom: 'bam'}]}}};
	 * const ctrl = fg.get('foo.bar.baz.0.boom');
	 * const fullPath = FormHelperService.getFullControlPath(ctrl); // ==> '.foo.bar.baz.0.bada'
	 */
	static getFullControlPath(control: AbstractControl): string {
		let pathItems: string[] = [FormHelperService.getControlName(control)];
		let ancestorCtrl = control.parent;
		while (ancestorCtrl) {
			pathItems.push(FormHelperService.getControlName(ancestorCtrl));
			ancestorCtrl = ancestorCtrl.parent;
		}
		pathItems = pathItems.reverse();
		if (pathItems[0] === 'TopControl') {
			pathItems.shift();
		}
		return pathItems.join('.');
	}

	/**
	 * Get the type of control
	 * @param control
	 */
	static getControlType(control: AbstractControl): FormControlType {
		if (control instanceof FormGroup) {
			return 'FormGroup';
		} else if (control instanceof FormArray) {
			return 'FormArray';
		} else {
			return 'FormControl';
		}
	}

	/**
	 * Clones an abstract control and its validators.
	 * Credit: https://stackoverflow.com/questions/48308414/deep-copy-of-angular-reactive-form
	 * @param control
	 */
	static cloneAbstractControl<T extends AbstractControl>(control: T): T {
		let newControl: T;
		if (control instanceof FormGroup) {
			const formGroup = new FormGroup({}, control.validator, control.asyncValidator);
			const controls = control.controls;
			Object.keys(controls).forEach(key => {
				formGroup.addControl(key, FormHelperService.cloneAbstractControl(controls[key]));
			});
			newControl = formGroup as any;
		} else if (control instanceof FormArray) {
			const formArray = new FormArray([], control.validator, control.asyncValidator);
			control.controls.forEach(formControl => formArray.push(FormHelperService.cloneAbstractControl(formControl)));
			newControl = formArray as any;
		} else if (control instanceof FormControl) {
			newControl = new FormControl(control.value, control.validator, control.asyncValidator) as any;
		} else {
			throw new Error('Error: unexpected control type');
		}
		if (control.disabled) {
			newControl.disable({emitEvent: false});
		}
		return newControl;
	}
}

import {HttpRequest, HttpResponse} from '@angular/common/http';
import {Injectable} from '@angular/core';
import {CachableRoutePatterns} from '@core/interfaces/api.interface';
import {LocalStorageTypes} from '@core/services/local-storage/local-storage.interface';
import {LocalStorageService} from '@core/services/local-storage/local-storage.service';
import {Logger} from '@core/services/logger/logger';
import * as Route from 'route-parser';

abstract class HttpCache {
	abstract get(req: HttpRequest<any>): HttpResponse<any> | null;
	abstract put(req: HttpRequest<any>, res: HttpResponse<any>): void;
	abstract delete(req: HttpRequest<any>): boolean;
}

@Injectable({
	providedIn: 'root'
})
export class HttpCacheService implements HttpCache {
	cache: { [key: string]: HttpResponse<any> } = {};
	cachableRoutes = CachableRoutePatterns;

	constructor() {
		Logger.debug(`HttpCacheService constructed for ${Object.keys(this.cachableRoutes).join(',\n')}`);
	}

	/**
	 * Get an item from the cache
	 * @param req
	 */
	get(req: HttpRequest<any>): HttpResponse<any> {
		const cachedItem = this.shouldCacheToSessionStorage(req.urlWithParams)
			? LocalStorageService.getItem(LocalStorageTypes.SESSION, req.urlWithParams)
			: this.cache[req.urlWithParams];
		if (cachedItem) {
			return cachedItem;
		}
	}

	/**
	 * Put an item in the cache
	 * @param req
	 * @param res
	 */
	put(req: HttpRequest<any>, res: HttpResponse<any>): void {
		const shouldCache = this.shouldCache(req.urlWithParams);
		const shouldCacheToSessionStorage = this.shouldCacheToSessionStorage(req.urlWithParams);
		if (shouldCache && shouldCacheToSessionStorage) {
			this.cacheToSessionStorage(req.urlWithParams, res);
		}else if (shouldCache) {
			this.cacheToLocal(req.urlWithParams, res);
		}
	}

	/**
	 * Delete an item from the cache
	 * @param req
	 */
	delete(req: HttpRequest<any>): boolean {
		const cachedRequest = this.get(req);
		const shouldCacheToSessionStorage = this.shouldCacheToSessionStorage(req.urlWithParams);
		let returnVal = false;
		if (shouldCacheToSessionStorage && cachedRequest) {
			LocalStorageService.removeItem(LocalStorageTypes.SESSION, req.urlWithParams);
			returnVal = true;
		}else if (cachedRequest) {
			delete this.cache[req.urlWithParams];
			returnVal = true;
		}
		return returnVal;
	}

	/**
	 * Determine if a url SHOULD be cached or not. It must match a route pattern provided in
	 * @link(CachableRoutePatterns)
	 *
	 * @param urlWithParams
	 */
	shouldCache(urlWithParams: string) {
		let shouldCache = false;
		Object.keys(this.cachableRoutes).forEach((pattern) => {
			const route = new Route(pattern);
			const routeMatch = route.match(urlWithParams);
			if (routeMatch) {
				shouldCache = !!routeMatch;
			}
		});
		return shouldCache;
	}

	/**
	 * Determine if a url SHOUlD be placed in sessionStorage or not. It must match a route pattern provided in
	 * @link(CachableRoutePatterns) AND the item in CachableRoutePatterns must have a value of `true`
	 *
	 * @param urlWithParams
	 */
	shouldCacheToSessionStorage(urlWithParams: string) {
		let shouldCache = false;
		Object.keys(this.cachableRoutes).forEach((pattern) => {
			const route = new Route(pattern);
			const routeMatch = route.match(urlWithParams);
			if (routeMatch && this.cachableRoutes[pattern] === true) {
				shouldCache = !!routeMatch;
			}
		});
		return shouldCache;
	}

	/**
	 * Place the response in the local `cache` variable
	 *
	 * @param urlWithParams
	 * @param res
	 */
	cacheToLocal(urlWithParams: string, res: HttpResponse<any>) {
		this.cache[urlWithParams] = res;
	}

	/**
	 * Place the response in sessionStorage
	 * @param urlWithParams
	 * @param res
	 */
	cacheToSessionStorage(urlWithParams: string, res: HttpResponse<any>) {
		LocalStorageService.setItem(LocalStorageTypes.SESSION, urlWithParams, res);
	}
}

import {Injectable} from '@angular/core';
import {
	HttpRequest,
	HttpHandler,
	HttpEvent,
	HttpResponse, HttpErrorResponse
} from '@angular/common/http';
import {HttpCacheService} from '@core/services/http-cache/http-cache.service';
import {Logger} from '@core/services/logger/logger';
import {Observable, of} from 'rxjs';
import {catchError, finalize, tap} from 'rxjs/operators';
import {LoadingService} from '@layout/services/loading/loading.service';

/**
 * Intercept all http requests
 * @class {HttpRequestInterceptor}
 */
@Injectable()
export class HttpRequestInterceptor implements HttpRequestInterceptor {

	constructor(
		private _loading: LoadingService,
		private _cache: HttpCacheService
	) {}

	/**
	 * When an http request starts, set loading to true. When the request is finished, set loading to false.
	 * If an error is thrown be sure loading is set to false.
	 * @param {HttpRequest} request
	 * @param {HttpHandler} next
	 * @returns {Observable<HttpEvent<any>>}
	 */
	intercept(request: HttpRequest<any>, next: HttpHandler): Observable<HttpEvent<any>> {
		this._loading.setLoading(true, request);
		let cachedResponse;
		if (request.method === 'GET') {
			cachedResponse = this._cache.get(request);
			if (cachedResponse) {
				Logger.debug(`Response from cache for ${request.urlWithParams}`, cachedResponse);
			}
		}else if (request.method === 'POST' || request.method === 'PUT' || request.method === 'PATCH' || request.method === 'DELETE') {
			const removedFromCache = this._cache.delete(request);
			if (removedFromCache) {
				Logger.debug(`Cleared ${request.urlWithParams} from the cache`);
			}
		}
		return next.handle(request)
			.pipe(
				tap<HttpEvent<any>>((httpEvent: HttpEvent<any>) => {
					if (httpEvent instanceof HttpResponse) {
						this._cache.put(request, httpEvent);
					}
					return cachedResponse ? cachedResponse : httpEvent;
				}),
				catchError((err: HttpErrorResponse) => {
					throw err;
				}),
				finalize(() => {
					this._loading.setLoading(false, request);
				})
			);
	}
}

import {HttpClient, HttpErrorResponse, HttpHeaders, HttpParams, HttpResponse} from '@angular/common/http';
import {Injectable} from '@angular/core';
import {Router} from '@angular/router';
import {ApiMethod, ApiRouteToClass} from '@core/interfaces/api.interface';
import {HttpRequestConfig} from '@core/services/http/http.interface';
import {Logger} from '@core/services/logger/logger';
import {Observable} from 'rxjs';
import {catchError, map} from 'rxjs/operators';
import {AppErrorHandler} from '@core/services/error-handler/error-handler.service';

/**
 * This service is for handling all http requests and responses. If an error occurs, handle the error.
 * If the request route is defined in {@link ApiRouteToClass} will automatically deserialize the Raw object
 * into it's respective class.
 */
@Injectable({
	providedIn: 'root'
})
export class HttpService {

	constructor(
		private _http: HttpClient,
		private _error: AppErrorHandler,
		private _router: Router
	) {}

	/**
	 * Make an http request
	 * @param apiUrl {ApiEndpoints | string}
	 * @param method {ApiMethod}
	 * @param body {any}
	 * @param config
	 * @returns {Observable<any>}
	 */
	doRequest(apiUrl: string, method: ApiMethod, body?: any, config?: HttpRequestConfig) {
		let response: Observable<any>;
		let reqObservable: Observable<any>;
		if (method === ApiMethod.GET || method === ApiMethod.DELETE) {
			if (!config && body) {
				config = {observe: body};
			}else if (config && body) {
				config.observe = body;
			}
		}
		switch (method) {
			case ApiMethod.GET:
				reqObservable = this._http.get(apiUrl, config);
				break;
			case ApiMethod.DELETE:
				reqObservable = this._http.delete(apiUrl, config);
				break;
			case ApiMethod.PATCH:
				reqObservable = this._http.patch(apiUrl, body, config);
				break;
			case ApiMethod.POST:
				reqObservable = this._http.post(apiUrl, body, config);
				break;
			case ApiMethod.PUT:
				reqObservable = this._http.put(apiUrl, body, config);
				break;
		}
		response = reqObservable
			.pipe(
				map((resp: HttpResponse<any>) => { // Convert our raw object to a class instance
					const clazz = this.getRouteClass(apiUrl);
					if (clazz) {
						if (Array.isArray(resp)) {
							return resp.map(item => clazz.deserialize(item));
						} else {
							return clazz.deserialize(resp);
						}
					}
					return resp;
				}),
				catchError((err: HttpErrorResponse) => {
					throw err;
				})
			);
		return response;
	}

	/**
	 * Assumes an apiUrl like "/api/something/..." that matches
	 * @param {string} apiUrl
	 * @returns {Class | undefined}
	 * {@link ApiRouteToClass}
	 */
	getRouteClass(apiUrl: string) {
		let clazz;
		if (apiUrl) {
			const pathKey = apiUrl.split('/')
				.filter(Boolean) // remove empty string/null/undefined items
				.slice(0, 2) // remove everything past the 2nd path part (i.e. '/api/auth/<remove>/<everything>/<else>
				.join('/'); // Put it all back together
			clazz = ApiRouteToClass[`/${pathKey}`] || undefined;
		}
		return clazz;
	}
}

