import {HttpRequest} from '@angular/common/http';
import {Injectable} from '@angular/core';
import {SetLoadingAction} from '@core/root-store/loading/loading.action';
import {Store} from '@ngrx/store';

/**
 * This service is for managing the state of a loading spinner
 */
@Injectable({
	providedIn: 'root'
})
export class LoadingService {
	loadingMap: Map<HttpRequest<any>, boolean> = new Map<HttpRequest<any>, boolean>();

	constructor(
		private store: Store<{loading: boolean}>
	) {}

	/**
	 * This method is only called from the {@link HttpRequestInterceptor}
	 * We can't just dispatch the action with the value of the loading argument, we
	 * must ensure that there are no pending requests still loading in the loadingMap
	 * @param loading {boolean}
	 * @param request {string}
	 */
	setLoading(loading: boolean, request: HttpRequest<any>) {
		if (loading === true) {
			this.loadingMap.set(request, loading);
			this.store.dispatch(new SetLoadingAction(true));
		} else if (loading === false && this.loadingMap.has(request)) {
			this.loadingMap.delete(request);
			if (this.loadingMap.size === 0) {
				this.store.dispatch(new SetLoadingAction(false));
			}
		}
	}
}

import {Injectable} from '@angular/core';
import {LocalStorageTypes} from '@core/services/local-storage/local-storage.interface';
import {PROJECT_NAME} from 'src/environments/environment';

@Injectable({
	providedIn: 'root'
})
export class LocalStorageService {

	/**
	 * Get the storage facility
	 * @param storageType {LocalStorageTypes}
	 * @private
	 * @returns {localStorage|sessionStorage}
	 */
	private static _getStorage(storageType: LocalStorageTypes) {
		return storageType === LocalStorageTypes.LOCAL ? localStorage : sessionStorage;
	}

	/**
	 * Get a localStorage or sessionStorage item value
	 * @param storageType {'local'|'session'}
	 * @param key {string}
	 */
	static getItem(storageType: LocalStorageTypes, key: string) {
		const storage = LocalStorageService._getStorage(storageType);
		const val = storage.getItem(`${PROJECT_NAME}:${key}`);
		try {
			return JSON.parse(val);
		} catch (e) {
			return val;
		}
	}

	/**
	 * Set a localStorage or sessionStorage item value
	 * @param storageType {LocalStorageTypes}
	 * @param key {string}
	 * @param value {any}
	 */
	static setItem(storageType: LocalStorageTypes, key: string, value: any) {
		const storage = LocalStorageService._getStorage(storageType);
		const val = typeof value === 'string' ? value : JSON.stringify(value);
		storage.setItem(`${PROJECT_NAME}:${key}`, val);
	}

	/**
	 * Remove an item from localStorage or sessionStorage
	 * @param storageType {LocalStorageTypes}
	 * @param key {string}
	 */
	static removeItem(storageType: LocalStorageTypes, key: string) {
		const storage = LocalStorageService._getStorage(storageType);
		storage.removeItem(`${PROJECT_NAME}:${key}`);
	}

}

