import {HttpRequest, HttpResponse} from '@angular/common/http';
import {Injectable} from '@angular/core';
import {CachableRoutePatterns} from '@core/interfaces/api.interface';
import {LocalStorageTypes} from '@core/services/local-storage/local-storage.interface';
import {LocalStorageService} from '@core/services/local-storage/local-storage.service';
import {Logger} from '@core/services/logger/logger';
import * as Route from 'route-parser';

abstract class HttpCache {
	abstract get(req: HttpRequest<any>): HttpResponse<any> | null;
	abstract put(req: HttpRequest<any>, res: HttpResponse<any>): void;
	abstract delete(req: HttpRequest<any>): boolean;
}

@Injectable({
	providedIn: 'root'
})
export class HttpCacheService implements HttpCache {
	cache: { [key: string]: HttpResponse<any> } = {};
	cachableRoutes = CachableRoutePatterns;

	constructor() {
		Logger.debug(`HttpCacheService constructed for ${Object.keys(this.cachableRoutes).join(',\n')}`);
	}

	/**
	 * Get an item from the cache
	 * @param req
	 */
	get(req: HttpRequest<any>): HttpResponse<any> {
		const cachedItem = this.shouldCacheToSessionStorage(req.urlWithParams)
			? LocalStorageService.getItem(LocalStorageTypes.SESSION, req.urlWithParams)
			: this.cache[req.urlWithParams];
		if (cachedItem) {
			return cachedItem;
		}
	}

	/**
	 * Put an item in the cache
	 * @param req
	 * @param res
	 */
	put(req: HttpRequest<any>, res: HttpResponse<any>): void {
		const shouldCache = this.shouldCache(req.urlWithParams);
		const shouldCacheToSessionStorage = this.shouldCacheToSessionStorage(req.urlWithParams);
		if (shouldCache && shouldCacheToSessionStorage) {
			this.cacheToSessionStorage(req.urlWithParams, res);
		}else if (shouldCache) {
			this.cacheToLocal(req.urlWithParams, res);
		}
	}

	/**
	 * Delete an item from the cache
	 * @param req
	 */
	delete(req: HttpRequest<any>): boolean {
		const cachedRequest = this.get(req);
		const shouldCacheToSessionStorage = this.shouldCacheToSessionStorage(req.urlWithParams);
		let returnVal = false;
		if (shouldCacheToSessionStorage && cachedRequest) {
			LocalStorageService.removeItem(LocalStorageTypes.SESSION, req.urlWithParams);
			returnVal = true;
		}else if (cachedRequest) {
			delete this.cache[req.urlWithParams];
			returnVal = true;
		}
		return returnVal;
	}

	/**
	 * Determine if a url SHOULD be cached or not. It must match a route pattern provided in
	 * @link(CachableRoutePatterns)
	 *
	 * @param urlWithParams
	 */
	shouldCache(urlWithParams: string) {
		let shouldCache = false;
		Object.keys(this.cachableRoutes).forEach((pattern) => {
			const route = new Route(pattern);
			const routeMatch = route.match(urlWithParams);
			if (routeMatch) {
				shouldCache = !!routeMatch;
			}
		});
		return shouldCache;
	}

	/**
	 * Determine if a url SHOUlD be placed in sessionStorage or not. It must match a route pattern provided in
	 * @link(CachableRoutePatterns) AND the item in CachableRoutePatterns must have a value of `true`
	 *
	 * @param urlWithParams
	 */
	shouldCacheToSessionStorage(urlWithParams: string) {
		let shouldCache = false;
		Object.keys(this.cachableRoutes).forEach((pattern) => {
			const route = new Route(pattern);
			const routeMatch = route.match(urlWithParams);
			if (routeMatch && this.cachableRoutes[pattern] === true) {
				shouldCache = !!routeMatch;
			}
		});
		return shouldCache;
	}

	/**
	 * Place the response in the local `cache` variable
	 *
	 * @param urlWithParams
	 * @param res
	 */
	cacheToLocal(urlWithParams: string, res: HttpResponse<any>) {
		this.cache[urlWithParams] = res;
	}

	/**
	 * Place the response in sessionStorage
	 * @param urlWithParams
	 * @param res
	 */
	cacheToSessionStorage(urlWithParams: string, res: HttpResponse<any>) {
		LocalStorageService.setItem(LocalStorageTypes.SESSION, urlWithParams, res);
	}
}

import {HttpClient} from '@angular/common/http';
import {ApiMethod} from '@core/interfaces/api.interface';
import {AppState} from '@core/root-store/models/app-state.model';
import {HttpService} from '@core/services/http/http.service';
import {LogLevel} from '@core/services/logger/logger.interface';
import {AbstractTransport} from '@core/services/logger/abstract-transport';
import {LogEntry} from '@core/services/logger/log-entry';
import {ServiceLocator} from '@core/services/service-locator';
import {Store} from '@ngrx/store';
import {BehaviorSubject, throwError} from 'rxjs';
import {catchError} from 'rxjs/operators';

export class HttpTransport extends AbstractTransport {
	/**
	 * Set to true to include the date in the logging message
	 */
	readonly logWithDate = true;
	/**
	 * Set to true if entries should be persisted to db
	 */
	readonly shouldPersist = true;
	/**
	 * Set to true if entries should notify the user
	 */
	readonly shouldNotifyUser = false;
	/**
	 * The log entries that will be sent to the server
	 */
	logs: BehaviorSubject<LogEntry[]> = new BehaviorSubject<LogEntry[]>([]);
	/**
	 * The number of logs to hold before sending to the server
	 */
	flushThreshold: number = 10;
	/**
	 * The interval to flush the logs. If we never reach the flushThreshold this will
	 * ensure the logs are sent
	 */
	flushIntervalMs: number = 60000;
	/**
	 * The interval method so we can clear/stop the interval
	 */
	flushInterval: any;
	/**
	 * The application state when the error occurred
	 * @private
	 */
	private appState;
	private storeListener;

	constructor(level: LogLevel) {
		super(level);
		this.listenToLogs();
		// Setup an interval to flush every 10 minutes (600000ms)(flushIntervalMs)
		this.flushInterval = setInterval(() => {
			this.flush();
		}, this.flushIntervalMs);
	}

	/**
	 * Listen to the ngrx-store application state. Anytime it changes
	 * update the local appState property. This is to include the application
	 * state in error messages
	 * @private
	 */
	private _listenToStore() {
		ServiceLocator.observableInjector
			.subscribe((injector) => {
				if (injector && !this.storeListener) {
					const store = injector.get(Store);
					this.storeListener = store.select((appState: AppState) => appState)
						.subscribe((appState) => {
							this.appState = {...appState};
						});
				}
			});
	}

	/**
	 * Listen to the logs array. If we get a certain amount or reach a time
	 * threshold then send the log entries to the backend to be persisted and
	 * clear the array
	 */
	listenToLogs() {
		this.logs
			.subscribe((logs) => {
				if (logs && logs.length && logs.length === this.flushThreshold) {
					this.flush();
				}
			});
	}

	/**
	 * Just adds the log entry to the logs array
	 * @param logEntry
	 * @returns {LogEntry}
	 */
	log(logEntry: LogEntry) {
		const currentLogs = this.logs.value;
		if (logEntry.shouldPersist) {
			logEntry.params.push(this.appState);
			const newLogs = [...currentLogs, logEntry];
			this.logs.next(newLogs);
		}
		return logEntry;
	}

	/**
	 * Sends the logs array to the server
	 */
	flush() {
		const logs = Array.from(this.logs.value);
		if (logs.length > 0) {
			const httpService = ServiceLocator.injector.get(HttpService);
			httpService.doRequest('/api/logs', ApiMethod.POST, logs)
				.pipe(catchError((err) => {
					return throwError(err);
				}))
				.subscribe((response) => {
					this.logs.next([]);
				});
		}
	}
}

import {LogLevel} from '@core/services/logger/logger.interface';
import {User} from '@core/models/user.model';

export class LogEntry {
	/**
	 * The date this entry was created
	 */
	entryDate: string = new Date().toISOString();
	/**
	 * Set to true to include the date in the log output
	 * @private
	 */
	private _logWithDate = true;
	/**
	 * Set to true to persist to a database. Only works if the {@link AbstractTransport}
	 * supports it
	 * @private
	 */
	private _shouldPersist = false;
	/**
	 * Set to true to display a toast message to notify the user
	 * @private
	 */
	private _shouldNotifyUser = false;
	/**
	 * The user for the log entry
	 * @private
	 */
	private _user: User;

	constructor(
		public level: LogLevel,
		public message: string,
		public params?: any[]
	) {}

	get logWithDate() {
		return this._logWithDate;
	}

	set logWithDate(logWithDate: boolean) {
		this._logWithDate = logWithDate;
	}

	get shouldPersist() {
		return this._shouldPersist;
	}

	set shouldPersist(shouldPersist: boolean) {
		this._shouldPersist = shouldPersist;
	}

	get shouldNotifyUser() {
		return this._shouldNotifyUser;
	}

	set shouldNotifyUser(shouldNotifyUser) {
		this._shouldNotifyUser = shouldNotifyUser;
	}

	get user() {
		return this._user;
	}

	set user(user) {
		this._user = user;
	}

	/**
	 * Convert this log entry to JSON
	 */
	toJson() {
		return JSON.parse(JSON.stringify(this));
	}

	/**
	 * Convert this log entry to a JSON string
	 */
	toString() {
		return JSON.stringify(this);
	}

	/**
	 * Convert this to a formatted JSON string
	 */
	toFormattedString() {
		return JSON.stringify(this, null, 2);
	}
}

